import { questions } from './Faqapi';
import './Faq.css'


const Faq = () => {
    const [data, setdata] = useState(questions);
    return (
        <>
            {
                data.map((currElement)=>{
                 return currElement.id 
             })
            }
        </>
    )
}

export default Faq
